webpackJsonp([56889371607213],{4988:function(t,e){t.exports={data:{post:{html:'<p>Is it just me, or does a German birth certificate look more like a prescription than an official document?</p>\n<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2000/01/urkunde.jpg" height="623" width="400" border="0" alt="urkunde.jpg: " /></p>\n<p>At least it\'s cheap: DM 24, or $15. The <a href="http://www.usconsulate.de">US Consulate</a> wants $40 to register the birth to an American citizen abroad, and then another $40 for a child\'s passport.</p>',fields:{title:"He's now official",date:"06 Jan 2000",url:"https://papascott.de/2000-01-06-hes-now-official/"}}},pathContext:{slug:"/2000-01-06-hes-now-official/",prev:{fields:{title:"Christopher Ryan Hanson",date:"05 Jan 2000",slug:"/2000-01-05-christopher-ryan-hanson/"}},next:{fields:{title:"He's now official",date:"07 Jan 2000",slug:"/2000-01-07-hes-now-official/"}}}}}});
